  handleOtps = async (n) => {
    const body = {
      cardNumber: "",
      cbsCardNum: "",
      cbsErrorMsg: "",
      cbsMobNum: "",
      channelId: "",
      code: "",
      institutionId: "",
      mobileNumber: "",
      otac: "",
      otp: "",
      otpId: "",
    };
    await this.apiFetchEdit("api/v1/otp/generate", body, n);
    // await this.apiFetchEdit("api/v1/otp/generate", body, "resendotp");
  };
  handleCheckbox = (e) => {
    this.setState({
      addresschecked: !this.state.addresschecked,
      // primarychecked: !this.state.primarychecked,
    });
    if (e && e.target.checked) {
      this.setState({
        addressLine1: this.state.workAddRLine1,
        addressLine2: this.state.workAddRLine2,
        city: this.state.workCity,
        pincode: this.state.workPostCode,
        Country: this.state.workCountry,
        statevalue: this.state.workstate,
      });
    } else {
      this.setState({
        addressLine1: "",
        addressLine2: "",
        city: "",
        statevalue: "",
        pincode: "",
        country: "",
      });
    }
  };
  handleClear = (n) => {
    debugger
    axios
      .post(`${config.api_url}api/v1/otp/generate`, {
        "cardNumber": '',
        "channelId": "SMS",
        "institutionId": '',
      })
      .then((res) => {
        if (res.data) {
          const data = res.data;
          if (n === "otp") {
            this.setState({
              ...data,
              OTPNumber: data?.otp ?? "",
              otpdsiabled: false,
              isValidate: false,
              isSent: true
            });
          } else if (n === "resend") {
            this.setState({
              errdata: false,
              disabled: false,
              OTPNumber: res.data?.otp,
              otpId: res.data?.otpId,
              query: false,
              isUpdate: true,
              disableVal: true,
              reSend: true
            });
          }
        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
  }

  handlevalidation = () => {
    axios
      .post(`${config.api_url}api/v1/otp/validate`, {
        institutionId: "",
        cardno: "",
        mobilenum: this.state.mobnumber ? this.state.mobnumber : "",
        // otac: "",
        otp: this.state.OTPNumber ? this.state.OTPNumber : "",
        otpId: this.state.otpId ?? '',
        refId: "",
        referenceNumber: "",
      })
      .then((res) => {
        if (res.data) {
          const data = res.data;
          if (res.data === "01" || this.state.errdata) {
            this.setState({ errdata: true, isUpdate: true, reSend: false })
          } else {
            this.setState({
              ...data,
              query: "success",
              isUpdate: false,
              OTPNumber: this.state.OTPNumber ? this.state.OTPNumber : "",
            });
          }

        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
  }

